import React from 'react';
import { NavLink } from 'react-router-dom';
import Home from '../Home'
import s from './Navbar.module.css';

function Navbar() {
    Home.scroll({
        top: 500,
        left: 100,
        behavior: 'smooth'
      });
    return (
        <nav>
            <NavLink className={s.logo} to='/Home'>TigranMets</NavLink >‎‎‎
            <div className={s.left_nav}>
                <NavLink className={s.navItem} onclick={scroll()} to='/Home'>Home ‏‏‎ ‎</NavLink>
                <NavLink className={s.navItem} to='/About'>About‏‏‎‏‏‎‏‏‎ me ‎‏‏‎ ‎</NavLink>
                <NavLink className={s.navItem} to='/Portfolio'>Portfolio ‏‏‎ ‎</NavLink>
                <NavLink className={s.navItem} to='/Experience'>Experience ‏‏‎ ‎</NavLink>
                <NavLink className={s.navItem} to='/Blog'>Blog</NavLink>
            </div>
        </nav>
    );
}

export default Navbar;
